import React from "react";

// Import component
import Card from "./card";



function Forecast({forecasts}){
    console.log(forecasts);

    return(
        <div className="cards-container">
            {forecasts.map((forecasts) => (
                <Card
                    key={forecasts.id}
                    day={forecasts.day}
                    temp={forecasts.temp}
                    clouds={forecasts.clouds}
                    high={forecasts.high}
                    low={forecasts.low}
                />
            ))
            }
        </div>
    );
};

export default Forecast;
